import React from 'react';

const ItemCart = ({item}) => {
    return (
        <div>
            <th scope="col">Producto:</th>
            {item.name} 
            Cantidad pedida:
            {item.amount} 
            Precio:
            ${item.price}
        </div>
    );
}

export default ItemCart;
